def CoolPara(words):
    numwords=0
    longwords=0
    rarewords=0
    rare= ['j' , 'x' , 'q' , 'z'] 
    numwords= len(words.split())
    print(str(numwords), "words in the input paragraph")
    split= words.split()

    for char in split: 
        if (len(char) >=8):
            longwords= longwords + 1
    for char in words:  
        if char in rare:
            rarewords= rarewords + 1    
    print(str(rarewords), "word with a rare character")
    print(str(longwords), "words that have 8 letters or more")

    if((numwords>10) and (rarewords >= 0.1*numwords) and (longwords >= 0.1*numwords)):
        return True
    return False

print(CoolPara(input("Enter: ")))
